var CountryHeader = React.createClass({
    render: function() {
        return (
            <div className="row">
                <div className="col-md-12">
                    <header className="text-center">
                        <h1>{this.props.country}</h1>
                    </header>
                </div>
            </div>
        );
    }
});

var Gallery = React.createClass({
    render: function() {
        var images;
        if (COUNTRIES[this.props.country] != undefined) {
            images = COUNTRIES[this.props.country].items.items;

            DUPA = images;
            var new_images = images.map((img) => {
                return <div className="div-gallery-item"><img className="gallery-item" src={img.img_src} alt={img.title} /></div>;
            });
            new_images = new_images.slice(0,3);

        }
        else {
            images = "";
        }

        return (
            <div className="row">
                <ul>
                    {new_images}
                </ul>
            </div>
        );
    }
});

var UnescoList = React.createClass({
    getInitialState: function() {
        return {
            data: null
        };
    },


    render: function() {
        var items;
        if (COUNTRIES[this.props.country] != undefined) {
            items = COUNTRIES[this.props.country].items.items;
            items = items.map((img) => {
                return <li>{img.title}</li>;
            });
            items = items.slice(0,10);

        }
        else {
            items = "";
        }

        return (
            <div className="row">
                <div className="opis-kraju">
                    <p className="obiekty">Obiekty z listy UNESCO:</p>
                    <ul>
                        {items}
                    </ul>
                    <button className="btn btn-primary wstecz" onClick={() => {this.props.router.switchTo('offers')}}>Wstecz</button>
                </div>
            </div>
        );
    }
});

var CountryPage = React.createClass({
    render: function() {
        var country = this.props.args.split('?')[1].split('&')[0].split('=')[1];
        var en = this.props.args.split('?')[1].split('&')[1].split('=')[1];

        return (
            <div id="wrapper">
                <CountryHeader country={country} />
                <Gallery country={country} />
                <hr />
                <UnescoList country={country} en={en} router={this.props.router} />
            </div>
        );
    }
});


